'use strict';
let GetOrdersMessage = require('./GetOrdersMessage.js');
let stdlib = require('@gehtsoft/LuaxStdlib-node').stdlib;
class GetOrdersMessageBuilder extends GetOrdersMessage {
    addOrder(order) {
        this.ordersList.add(order);
    }
    addOrders(orders) {
        let i;
        if (this.ordersList == null) {
            stdlib.print("ordersList == nil");
        }
        if (orders != null) {
            for (i = 0; i <= orders.length() - 1; i += 1) {
                this.ordersList.add(orders.get(i));
            }
        }
    }
    setAccountId(accountId) {
        this.accountId = accountId;
    }
    build() {
        return this;
    }
}
module.exports = GetOrdersMessageBuilder
